import styles from "./index.module.scss";
import location from "../../../images/icons/location.svg";

export const FooterContacts = () => {
  return (
    <div className={styles.contacts}>
      <h4>Контакты</h4>
      <div>
        <img src={location} alt="" />
      </div>
    </div>
  );
};
